long_desc.thetext:
As a basic example, I have a simple form, with one text field and an Ok and a Cancel button. When I enter data in the text field and then *click* on Ok, the "execute" handler sees that the model contains the value from the text field, and all is good with the world. 

I have also provided a qx.ui.core.Command("Enter") instance to the Ok button. If instead of *clicking* on the Ok button, I just press Enter, the model does not contain the value from the text field. I tried adding ok.focus() into the "execute" handler but that did not sync the data. How do I force the model to sync to the field data?

The attachment contains a complete example demonstrating the problem.

From the ML discussion, Christian added the following comments:

---


Your described issue occurs with all my tested browser, so it is not a browser issue. :( 

I found a workaround to get the value. The first trick is to call a blur on the input field. This works for all browsers, but not for Opera. Opera needs a timeout :(

<snip>
ok.addListener(
        "execute", 
        function(e)
        {
          // blur input field to sync value with TextField
          input.getContentElement().getDomElement().blur();

          // Opera needs a timeout to sync the value
          qx.event.Timer.once(function()
          {
            // Retrieve the entered info
            var info = qx.util.Serializer.toNativeObject(this._model);
            alert("Text field contains '" + info.txtInput + "'");
          }, this, 0);
        },
        this);
</snip>

For me is is more a qooxdoo bug, the TextField doesn't get the value, because the "input" event is not fired because of the command execution. I trigger the "input" event by calling the blur on the input field. Could you please open a bug report and add your example app with my workaround.

---

ok, now it's clear for me why the focus on the button doesn't work. The focus is done asynchronous, that's the reason why it doesn't work. You have to flush all queues after the focus call. :(
